import React from "react";
import Cookies from 'universal-cookie';
import axios from 'axios';
const cookies = new Cookies();
class Fin extends React.Component {
    constructor(props) {
      super(props);
      this.state={};
    }
    
    render() {
        return (
            
            <div className="container">
              <div className="col">
                <h3 className="display-3 text-center text-light bg-dark">GANASTE!!!{cookies.get('Ganador')}</h3>
                <a href="http://localhost:3000/">Volver a Jugar</a>
              </div>
            </div>
        );
    }
}
 
export default Fin;
